import React, { useState } from 'react';
import '../styles/common.css';

function RegisterPage() {
  const [formData, setFormData] = useState({
    fullName: '',
    email: '',
    password: '',
    confirmPassword: ''
  });
  const [error, setError] = useState('');
  const [success, setSuccess] = useState(false);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setError('');
    setSuccess(false);

    if (!formData.email.includes('@')) {
      setError('Please enter a valid email.');
      return;
    }
    if (formData.password.length < 6) {
      setError('Password must be at least 6 characters.');
      return;
    }
    if (formData.password !== formData.confirmPassword) {
      setError('Passwords do not match.');
      return;
    }

    setSuccess(true);
  };

  return (
    <div className="reg-page-bg">
      <div className="register-card">
        <h2 className="register-title">Registration</h2>
        <form onSubmit={handleSubmit} className="register-form">

          <div className="form-field">
            <label htmlFor="fullName">Full Name</label>
            <input
              type="text"
              name="fullName"
              id="fullName"
              value={formData.fullName}
              onChange={handleChange}
              placeholder="Enter full name"
              required
            />
          </div>

          <div className="form-field">
            <label htmlFor="email">Email Address</label>
            <input
              type="email"
              name="email"
              id="email"
              value={formData.email}
              onChange={handleChange}
              placeholder="Enter email"
              required
            />
          </div>

          <div className="form-field">
            <label htmlFor="password">Password</label>
            <input
              type="password"
              name="password"
              id="password"
              value={formData.password}
              onChange={handleChange}
              placeholder="Create password"
              required
            />
          </div>

          <div className="form-field">
            <label htmlFor="confirmPassword">Confirm Password</label>
            <input
              type="password"
              name="confirmPassword"
              id="confirmPassword"
              value={formData.confirmPassword}
              onChange={handleChange}
              placeholder="Confirm password"
              required
            />
          </div>

          <button type="submit" className="signup-btn">Sign Up</button>

          {error && <div className="form-error">{error}</div>}
          {success && <div className="form-success">✅ Registered!</div>}

          <p className="redirect-text">
            Already have an account? <a href="/login">Login</a>
          </p>

          <div className="divider"><span>Or sign in with:</span></div>

          <button type="button" className="facebook-btn">
            <img src="/facebook-icon.png" alt="Facebook" style={{ height: '16px', marginRight: '8px', verticalAlign: 'middle' }} />
            Login with Facebook
          </button>

          <button type="button" className="google-btn">
            <img src="/google-icon.png" alt="Google" style={{ height: '16px', marginRight: '8px', verticalAlign: 'middle' }} />
            Login with Google
          </button>
        </form>
      </div>
    </div>
  );
}

export default RegisterPage;
